import './App.css';
import FooterComponent from './components/FooterComponent';
import HeaderComponent from './components/HeaderComponent';
import ListStudentsComponent from './components/ListStudentsComponent';

function App() {
  return (
    <div>
      <HeaderComponent />
      <ListStudentsComponent />
      <FooterComponent />
    </div>
  );
}

export default App;
